import React from 'react';
import { createMuiTheme, makeStyles } from '@material-ui/core/styles';

import CssBaseline from '@material-ui/core/CssBaseline';
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import Slider from '@material-ui/core/Slider';

export const theme = createMuiTheme({
    palette: {
        primary: {
            main: 'rgba(255, 0, 0, 1)',
        },
        secondary: {
            main: 'rgba(255, 0, 0, 1)',
        },
    },
});

const useStyles = makeStyles({
    root: {


    },
});

function Preferences() {
    const classes = useStyles();
    const [valueR, setValueR] = React.useState(0);
    const [valueG, setValueG] = React.useState(0);
    const [valueB, setValueB] = React.useState(0);

    const handleChangeR = (event, newValue) => {
        setValueR(newValue);
    };
    const handleChangeG = (event, newValue) => {
        setValueG(newValue);
    };
    const handleChangeB = (event, newValue) => {
        setValueB(newValue);
    };

    return (
        <Container>
            <CssBaseline className={classes.root}/>
            <div>

                <Typography gutterBottom>
                    Red 
            </Typography>
                <Grid container spacing={2}>
                    <Grid item>
                        0
                </Grid>
                    <Grid item xs>
                        <Slider value={valueR} onChange={handleChangeR} />
                    </Grid>
                    <Grid item>
                        255
                </Grid>
                </Grid>
                <Typography gutterBottom>
                    Green
            </Typography>
                <Grid container spacing={2}>
                    <Grid item>
                        0
                </Grid>
                    <Grid item xs>
                        <Slider value={valueG} onChange={handleChangeG} />
                    </Grid>
                    <Grid item>
                        255
                </Grid>
                </Grid>
                <Typography gutterBottom>
                    Blue
            </Typography>
                <Grid container spacing={2}>
                    <Grid item>
                        0
                </Grid>
                    <Grid item xs>
                        <Slider value={valueB} onChange={handleChangeB} />
                    </Grid>
                    <Grid item>
                        255
                </Grid>
                </Grid>

            </div>
        </Container>
    );
}

export default Preferences;
